import React from 'react';
import SocialMidea from './SocialMedias'
import { Redirect } from 'react-router-dom';

export default function TeacherCard({ teacher }) {

  return(
    <section>
      <h3>{ teacher.name }</h3>
      <span><i>{teacher.inspiration}</i></span>
      <SocialMidea
      thisMidea={ (teacher.facebook !== null) ? true : false }
      urlFaceBook={ teacher.facebook }
      urlInstagran={ teacher.instagran }
      />
      <button
      type="button"
      onClick={() => <Redirect to={`/quem-somos/${teacher.id}`} />}
      >
        Mais Detalhes
      </button>

    </section>
  );
}
